INSERT INTO `mamba_dim_report_definition` VALUES
(1,'mother_hiv_status','sp_mamba_mother_hiv_status_query','sp_mamba_mother_hiv_status_columns_query','SELECT pm.hiv_test_result AS hiv_test_result FROM mamba_flat_encounter_pmtct_anc pm INNER JOIN mamba_dim_person p ON pm.client_id = p.person_id WHERE p.uuid = person_uuid AND pm.ptracker_id = ptracker_id','mamba_dim_mother_hiv_status','MCH Mother HIV Status',NULL),
(2,'total_deliveries','sp_mamba_total_deliveries_query','sp_mamba_total_deliveries_columns_query','SELECT COUNT(*) AS total_deliveries FROM mamba_dim_encounter e inner join mamba_dim_encounter_type et on e.encounter_type = et.encounter_type_id WHERE et.uuid = \'6dc5308d-27c9-4d49-b16f-2c5e3c759757\' AND DATE(e.encounter_datetime) > CONCAT(YEAR(CURDATE()), \'-01-01 00:00:00\')','mamba_dim_total_deliveries','MCH Total Deliveries',NULL),
(3,'hiv_exposed_infants','sp_mamba_hiv_exposed_infants_query','sp_mamba_hiv_exposed_infants_columns_query','SELECT COUNT(DISTINCT ei.infant_client_id) AS total_hiv_exposed_infants FROM mamba_fact_pmtct_exposedinfants ei INNER JOIN mamba_dim_person p ON ei.infant_client_id = p.person_id WHERE ei.encounter_datetime BETWEEN DATE_FORMAT(NOW(), \'%Y-01-01\') AND CURDATE() AND birthdate BETWEEN DATE_FORMAT(NOW(), \'%Y-01-01\') AND CURDATE()','mamba_dim_hiv_exposed_infants','MCH HIV-Exposed Infants',NULL),
(4,'total_pregnant_women','sp_mamba_total_pregnant_women_query','sp_mamba_total_pregnant_women_columns_query','SELECT COUNT(DISTINCT pw.client_id) AS total_pregnant_women FROM mamba_fact_pmtct_pregnant_women pw WHERE visit_type like \'New%\' AND encounter_datetime BETWEEN DATE_FORMAT(NOW(), \'%Y-01-01\') AND CURDATE() AND DATE_ADD(date_of_last_menstrual_period, INTERVAL 40 WEEK) > CURDATE()','mamba_dim_total_pregnant_women','MCH Total Pregnant women',NULL);
